+		return nil, &types.ExecutionError{
+			Code:        "GITHUB_DOMAIN_NOT_ALLOWED",
+			Message:     "only api.github.com is allowed, got: " + client.BaseURL.Host,
+			Details:     map[string]any{"host": client.BaseURL.Host},
+			Recoverable: false,
+			Timestamp:   time.Now(),
